import React from 'react'

function Card() {
  return (
    <div className='bg-gray-200 w-full min-h-screen flex justify-center items-center'>
        <div className='w-60 bg-white rounded-xl'>
            <img src='https://images.deliveryhero.io/image/fd-tr/LH/jdym-listing.jpg?width=400&height=292' alt="hamburger" />
        </div>
    </div>
  )
}

export default Card
